	add("thallophyte", "{\"term\":\"thallophyte\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"multiple languages\"], \"text\":\"From Multiple languages {{taxlink|Thallophyta|division|noshow\u003d1}}. Surface reading of {{suffix|thallus|phyte|t2\u003dplant|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of very many primitive plants that consist of a thallus (plant body not differentiated into roots, stems and leaves), formerly collected in the obsolete taxonomic group Thallophyta\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Estrelita A. Madriaga, Anthony Lee, Felicitas B. Ventura, Orlando A. Oronce (coordinator), \u0027Biology: Science and Technology II\u0027, [http://books.google.com.au/books?id\u003dHPCEK9ZVmEQC\u0026amp;pg\u003dPA347\u0026amp;dq\u003d%22thallophyte%22%7C%22thallophytes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003deXb4Uv6NDon4lAXcq4D4CQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22thallophyte%22%7C%22thallophytes%22\u0026amp;f\u003dfalse page 347\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"They\u0026lt;sup\u0026gt;[algae, fungi and mosses]\u0026lt;/sup\u0026gt; lack the vascular tissues; thus, they are called \u0027\u0027thallophytes\u0027\u0027. Algae are \u0027\u0027thallophytes\u0027\u0027 with chlorophyll.Fungi are \u0027\u0027thallophytes\u0027\u0027 without chlorophyll\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Pat E. Rasmussen, \u0027Chapter IV.5: Mercury in Vegetation of the Precambrian Shield\u0027, Carl J. Watras, John W. Huckabee (editors), \u0027Mercury Pollution: Integration and Synthesis\u0027, [http://books.google.com.au/books?id\u003dOO0qtznwupcC\u0026amp;pg\u003dPA422\u0026amp;dq\u003d%22thallophyte%22%7C%22thallophytes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003deXb4Uv6NDon4lAXcq4D4CQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22thallophyte%22%7C%22thallophytes%22\u0026amp;f\u003dfalse page 422\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In general, the usefulness of the \u0027\u0027thallophytes\u0027\u0027 as Hg bioindicators was limited by their sporadic occurrence in the forest environment. Because of the importance of the \u0027\u0027thallophytes\u0027\u0027 as components of the food chain, however, several samples from different groups (summarized in Table 2) were collected for comparison with values reported in the literature\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, R. G. Hermann, \u0027The Chloroplast: Part of the Integrated Genetic System of the Plant Cell\u0027, Joan H. Argyroudi-Akoyunoglou, Horst Senger (editors), \u0027The Chloroplast: From Molecular Biology to Biotechnology\u0027, [http://books.google.com.au/books?id\u003dVbGPXMcvWhgC\u0026amp;pg\u003dPA66\u0026amp;dq\u003d%22thallophyte%22%7C%22thallophytes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003deXb4Uv6NDon4lAXcq4D4CQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22thallophyte%22%7C%22thallophytes%22\u0026amp;f\u003dfalse page 66\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Fossile records along with molecular, cytological and morphological phylogenetic work favour a single origin of land plants from charophycean \u0027\u0027thallophytes\u0027\u0027, and indicate that several major lineages of vascular plants had evolved more than 400 million years ago\", \"priority\":10}]}, \"synonyms\":{}}");

	add("thallus", "{\"term\":\"thallus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027θαλλός\u0027 (young shoot, twig) from Proto-indo-european {{m|ine-pro|*dʰal||to bloom}}, \"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An undifferentiated plant body, such as in algae\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any plant body lacking vascular tissue\", \"priority\":2}]}, \"synonyms\":{}}");

	add("thalweg", "{\"term\":\"thalweg\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\"], \"text\":\"From 19th century German \u0027thal\u0027 (valley) + \u0027weg\u0027 (way, course)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The line that connects the lowest points in a valley or river channel, and thus the line of fastest flow along a river’s course\", \"priority\":1}]}, \"synonyms\":{}}");

	add("thames", "{\"term\":\"thames\", \"etymology\":{\"influencers\":[], \"languages\":[\"Welsh\", \"English\", \"middle english (1100-1500)\", \"Irish\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027temese\u0027 from name for the river, \u0027Tamesas\u0027 (from *\u0027tamēssa\u0027),\u0026lt;ref name\u003dMalloryAdams147\u0026gt;Mallory, J.P. and D.Q. Adams. \u0027The Encyclopedia of Indo-European Culture\u0027. London: Fitzroy and Dearborn, 1997: 147.\u0026lt;/ref\u0026gt; recorded in Latin \u0027tamesis\u0027 and yielding modern Welsh \u0027tafwys\u0027 The name probably meant \u0026quot;dark\u0026quot; and can be compared to other cognates such as Irish \u0027teimheal\u0027 and Welsh \u0027tywyll\u0027 \u0026quot;darkness\u0026quot; (Proto-Celtic *\u0027temeslos\u0027) and Middle Irish \u0027teimen\u0027 \u0026quot;dark grey\u0026quot;,\u0026lt;ref name\u003dMalloryAdams147/\u0026gt; though Richard Coates\u0026lt;ref name\u003dcoates\u0026gt;Coates, Richard 1998 \u0026quot;A new explanation of the name of London\u0026quot;, \u0027Transactions of the Philological Society\u0027 96, 2 pp.203–229 http://www.blackwell-synergy.com/doi/pdf/10.1111/1467-968X.00027; doi \u003d 10.1111/1467-968X.00027\u0026lt;/ref\u0026gt; mentions other theories: Kenneth H. Jackson\u0027s\u0026lt;ref\u0026gt;Jackson, Kenneth H 1955 \u0026quot;The Pictish Language\u0026quot; in F. T. Wainright (ed.), \u0027The Problem of the Picts\u0027 Edinburgh; Nelson, pp. 129–166\u0026lt;/ref\u0026gt; that it is non-Indo-European (and of unknown meaning), and Peter Kitson\u0027s\u0026lt;ref\u0026gt;Kitson, Peter R 1996 \u0026quot;British and European River Names\u0026quot;, \u0027Transactions of the Philological Society\u0027 94, pp. 73–118; doi\u003d10.1111/j.1467-968X.1996.tb01178.x|issue\u003d2\u0026lt;/ref\u0026gt; that it is Indo-European but pre-Celtic Britain|Celtic and has a name indicating \u0026quot;muddiness\u0026quot; from a root \u0027*tā-\u0027, \u0027melt\u0027.Note also other river names such as Teme, Tavy, Teviot, Teifi.The river\u0027s name has always been pronounced with a simple \u0027t\u0027 /t/; the Middle English spelling was typically \u0027Temese\u0027. A similar spelling from this era (1210 AD), \u0026quot;Tamisiam\u0026quot;, is found in the Magna Carta.\u0026lt;ref\u0026gt;Ellis Sandoz, ed. \u0027The Roots of Liberty: Magna Carta…\u0027; Indianapolis; Amagi/Liberty Fund, pages 39, 347\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"River in southern England flowing 336 km (209 mi.) through London to the North Sea\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"River in Ontario province, Canada, flowing 258 km (160 mi.) to Lake St. Clair\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Estuary in the U.S. State of Connecticut flowing 24 km (15 mi.) past New London to Long Island Sound\", \"priority\":3}]}, \"synonyms\":{}}");

	add("thana", "{\"term\":\"thana\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hindi\"], \"text\":\"From Hindi\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An Indian military outpost\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A police station, or a police jurisdiction in India\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1888\u0027\u0027, Rudyard Kipling, ‘At Howli Thana’, \u0027Black and White\u0027, Folio Society 2005, p. 387\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"To this talk the dacoits agreed, and we had no trouble at the \u0027\u0027Thana\u0027\u0027, and could eat melons in peace, sitting upon our charpoys all day long\", \"priority\":4}]}, \"synonyms\":{}}");

	add("thane", "{\"term\":\"thane\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"ancient greek (to 1453)\", \"Dutch\", \"old norse\"], \"text\":\"From Middle english (1100-1500) {{m|enm|thane}}, {{m|enm|thein}}, {{m|enm|theign}}, from Old english (ca. 450-1100) {{m|ang|þæġn}}, {{m|ang|þeġen}}, \u0027þegn\u0027 from Proto-germanic {{m|gem-pro|*þegnaz||man, warrior}}, from Proto-indo-european {{m|ine-pro|*teke-||to give birth}}; akin to Dutch \u0027degen\u0027 German \u0027degen\u0027 Old norse \u0027þegn\u0027 and Ancient greek (to 1453) \u0027τέκνον\u0027 (child)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rank of nobility in pre-Norman England, roughly equivalent to baron.\u0026lt;ref\u0026gt;\u0026quot;[http://books.google.com.au/books?id\u003d6ZsRAAAAIAAJ\u0026amp;pg\u003dPA594\u0026amp;dq\u003d%22There+were+two+orders,+the+king%27s+thanes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d26ygUYzWFOyXiAfssoHACw\u0026amp;redir_esc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22There%20were%20two%20orders%2C%20the%20king\u0027s%20thanes%22\u0026amp;f\u003dfalse thane]\u0026quot;, entry in \u0027\u00271852\u0027\u0027, \u0027Putnam\u0027s Home Cyclopedia: Hand-Book of Literature and the Fine Arts\u0027, p594 — The \u0027\u0027thanes\u0027\u0027 in England were formerly persons of some dignity; there were two orders, the king\u0027s \u0027\u0027thanes\u0027\u0027, who attended the kings in their courts and held lands immediately of them, and the ordinary \u0027\u0027thanes\u0027\u0027, who were lords of manors and who had particular jurisdiction within their limits.After the [Norman] Conquest, this title was disused, and \u0027baron\u0027 took its place.\u0026lt;/ref\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1845\u0027\u0027, w:Johann Martin Johann Martin Lappenberg, w:Benjamin Benjamin Thorpe (translator), \u0027A History of England under the Anglo-Saxon Kings\u0027, 2004, [http://books.google.com.au/books?id\u003ddOQA3Y6q2WsC\u0026amp;pg\u003dPA317\u0026amp;dq\u003d%22Thane%22%7C%22thanes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ddbSgUa-BOcmziQf6_IGgDQ\u0026amp;redir_esc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Thane%22%7C%22thanes%22\u0026amp;f\u003dfalse page 317\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The Anglo-Saxon \u0027\u0027thanes\u0027\u0027 were in all respects the predecessors of the Norman barons\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The title of \u0027\u0027thane\u0027\u0027 seems to have supplanted that of gesith, which appears only in the earner Anglo-Saxon laws, a denomination that may originally have designated the attendants or companions of the king, and whose wergild being triple that of the simple freeman, were, therefore, denominated not only gesithcund men, but six-hynde men\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1910\u0027\u0027, Robert A. Thompson, \u0027The People\u0027s History of England\u0027, Walter Scott Publishing, New York\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The little island of Iona became the refuge of the sons and some \u0027\u0027thanes\u0027\u0027 of Athelfrith, banished by Edwin\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, w:Wulfstan (died Wulfstan, Robert Boenig (editor and translator), \u0027w:Sermo Lupi ad Sermo Lupi ad Anglos\u0027, \u0027Anglo-Saxon Spirituality: Selected Writings\u0027, [http://books.google.com.au/books?id\u003dovup9rSE5nMC\u0026amp;pg\u003dPA144\u0026amp;dq\u003d%22Thane%22%7C%22thanes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ddbSgUa-BOcmziQf6_IGgDQ\u0026amp;redir_esc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22Thane%22%7C%22thanes%22\u0026amp;f\u003dfalse page 144\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Although some serfs escape from their lord and turn away from Christendom to the Vikings and after this it happens that the clash of swords becomes common to \u0027\u0027thane\u0027\u0027 and serf, if the serf utterly kills the \u0027\u0027thane\u0027\u0027, he lies unpaid by all of the serf\u0027s kin\", \"priority\":11}]}, \"synonyms\":{}}");

	add("thanage", "{\"term\":\"thanage\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|thane|age|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The district in which a thane has jurisdiction\", \"priority\":1}]}, \"synonyms\":{}}");

	add("thanatology", "{\"term\":\"thanatology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|thanato|ology|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The scientific study of the mechanisms and forensic aspects of death\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The study of human aspects of death and the associated grief and rituals\", \"priority\":2}]}, \"synonyms\":{}}");

	add("thanatomania", "{\"term\":\"thanatomania\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|thanato|mania|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The morbid belief that one is fated to die, having been cursed or bewitched by an enemy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, Erwin Heinz Ackerknecht, Hans Huldrych Walser, Huldrych M. Koelbing, \u0027Medicine and ethnology: selected essays\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Suicide may also sometimes be effectuated by the mechanism of \u0027\u0027thanatomania\", \"priority\":3}]}, \"synonyms\":{}}");

