	add("thanatos", "{\"term\":\"thanatos\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027θάνατος\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The god of death, (specifically of a peaceful death), and twin brother of Hypnos (god of sleep); the Greek counterpart of Mors\", \"priority\":1}]}, \"synonyms\":{}}");

	add("thanatourism", "{\"term\":\"thanatourism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|thanato|tourism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Tourism involving travel to sites associated with death and suffering\", \"priority\":1}]}, \"synonyms\":{}}");

