	add("thankfulness", "{\"term\":\"thankfulness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|thankful|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being thankful\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1719-\u0027\u0027 w:Daniel Daniel Defoe, \u0027w:Robinson Robinson Crusoe\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"All our discontents about what we want appeared to me to spring from the want of \u0027\u0027thankfulness\u0027\u0027 for what we have\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d4|passage\u003dNo matter how early I came down, I would find him on the veranda, smoking cigarettes, or. And at last I began to realize in my harassed soul that all elusion was futile, and to take such holidays as I could get, when he was off with a girl, in a spirit of \u0027\u0027thankfulness\", \"priority\":4}]}, \"synonyms\":{}}");

